function main(){$("a.page-scroll").click(function(){if(location.pathname.replace(/^\//,"")==this.pathname.replace(/^\//,"")&&location.hostname==this.hostname){var a=$(this.hash);if((a=a.length?a:$("[name="+this.hash.slice(1)+"]")).length)return $("html,body").animate({scrollTop:a.offset().top-40},900),!1}}),$(window).bind("scroll",function(){var a=$(window).height()-600;$(window).scrollTop()>a?$(".navbar-default").addClass("on"):$(".navbar-default").removeClass("on")}),$("body").scrollspy({target:".navbar-default",offset:80}),$(".navbar-nav li a").click(function(a){$(".navbar-toggle").is(":visible")&&$(".navbar-collapse").collapse("hide")})}main();